import { DataPathRouterItemsType } from "../../types/types"
import { KEY_NAME_LS_DATA } from "../../context/ContextLine"
import LogInPage from "../../pages/LogInPage"
import SignInPage from "../../pages/SignInPage"

interface localStoreType {
    User: {
        isAuth: boolean,
        isInSystem: boolean
    }
}

function localStore(): localStoreType  {
    const localStoreItem = localStorage.getItem(KEY_NAME_LS_DATA)

    if (localStoreItem) {
        return JSON.parse((localStoreItem as string))
    }

    return {User: {isAuth: false, isInSystem: false}}
}

export const DataPublick: DataPathRouterItemsType = [
    {
        path: '/',
        element: <LogInPage />,
        id: 0,
    }
]

export const DataPrivate: DataPathRouterItemsType = [
    {
        path: '/',
        element: localStore().User.isAuth &&  localStore().User.isInSystem ? <SignInPage /> : undefined, //! undefined will be element / component "WorldPosts"
        id: 0
    },
    {
        path: '/MyPosts',
        element: undefined,
        id: 1
    },
    {
        path: '/WorldPosts',
        element: undefined,
        id: 2
    },
    {
        path: '/Profile',
        element: undefined,
        id: 3
    },
    {
        path: '/AboutThisProject',
        element: undefined,
        id: 4
    },
    {
        path: '/AboutMe',
        element: undefined,
        id: 5
    }
]
